window.bookSummaryJSON = "<p><b><i>A resurrected mummy. A reincarnated warrior. A living curse bent on revenge.</i></b></p> <p>Dawn and Jake Maxwell aren't your average newlyweds. Murdered and mummified in ancient Egypt, Dawn was regenerated by scientists - but she was reborn thanks to Jake's ardent, everlasting devotion to her. In their past lives, Jake served as her guardian, but their illicit love affair destroyed them both, thanks to the curse laid down by their ancient enemy, Anton Vahl. The curse drove them apart for eternity, or so their foe believed. But passion never dies, and love cannot be contained.</p> <p>Now, with their foe dead, the worst should be over for Jake and Dawn. Yet the curse Vahl set in motion lives on and hungers for vengeance. Their scorching passion for each other may be all that stands between them and total devastation.</p> <p><b><i>Reborn to Conquer</i></b><b> is the fourth and final book in the Reborn series of paranormal romances.</b></p>"; 
